import React from 'react';
const UpLoadForm = () => {


    const handleOnChage = (event) => {
        setValue({
            ...value,
            [event.target.name]: event.target.value,
        })
    }

    return (
        <React.Fragment>
            <input type="file" name="upload" className="upfile"/>
            <TextField id="outlined-basic" label="Category" variant="outlined" onChange={handleOnChage} value={value.category} name="category" />
            <TextField id="outlined-basic" label="Comment" variant="outlined" onChange={handleOnChage} value={value.comment} name="comment" />
            <Button className="btn-signin" onClick={upload}>Sign in</Button>
        </React.Fragment>
    );
}
export default UpLoadForm;
